import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [accuracy, setAccuracy] = useState(null);

  useEffect(() => {
    fetch("http://127.0.0.1:5000/test/ml") // Ensure the correct backend URL
      .then(res => res.json())
      .then(data => setAccuracy(data))
      .catch(err => console.error("Error fetching data:", err));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Classification Report</h1>
        {accuracy ? (
          <table border="1">
            <thead>
              <tr>
                <th>Metric</th>
                <th>Precision</th>
                <th>Recall</th>
                <th>F1-Score</th>
                <th>Support</th>
              </tr>
            </thead>
            <tbody>
              {Object.keys(accuracy).map((label, index) => {
                if (typeof accuracy[label] === "object") {
                  return (
                    <tr key={index}>
                      <td>{label}</td>
                      <td>{accuracy[label].precision?.toFixed(2)}</td>
                      <td>{accuracy[label].recall?.toFixed(2)}</td>
                      <td>{accuracy[label]["f1-score"]?.toFixed(2)}</td>
                      <td>{accuracy[label].support}</td>
                    </tr>
                  );
                }
                return null;
              })}
            </tbody>
          </table>
        ) : (
          <p>Loading...</p>
        )}
      </header>
    </div>
  );
}

export default App;
